import { Component } from '@angular/core';
import { HeaderComponent } from '../header/header.component';
import { FooterComponent } from '../footer/footer.component';
import { RouterOutlet } from '@angular/router';
import { CommonModule } from '@angular/common';
import { MatButtonModule } from '@angular/material/button';
import { MatSidenavModule } from '@angular/material/sidenav';
@Component({
  selector: 'app-mainpage',
  standalone: true,
  imports: [
    HeaderComponent,
    FooterComponent,
    RouterOutlet,
    CommonModule,
    MatButtonModule,
    MatSidenavModule,
    MatButtonModule,
  ],
  templateUrl: './mainpage.component.html',
  styleUrl: './mainpage.component.scss',
})
export class MainpageComponent {}
<!-- src\app\layout\mainpage\mainpage.component.html -->
<mat-drawer-container class="example-container" hasBackdrop="true">
  <mat-drawer #drawer mode="over">I'm a drawer</mat-drawer>
  <mat-drawer-content>
    <!-- Header -->
    <app-header (toggleDrawer)="drawer.toggle()"></app-header>
    <!-- Page -->
    <div class="content-wrapper">
      <router-outlet></router-outlet>
    </div>
    <!-- Footer -->
    <app-footer></app-footer>
  </mat-drawer-content>
  <button mat-raised-button (click)="drawer.toggle()">Toggle drawer</button>
</mat-drawer-container>
